public void init()
{
    QueryBuildRange         qbr;
    QueryBuildDataSource    qbd,qbd1;
    utcDateTime             lagdate;
    utcDateTime now = DateTimeUtil::utcNow();

    now = DateTimeUtil::applyTimeZoneOffset(now,DateTimeUtil::getClientMachineTimeZone());
    lagdate=DateTimeUtil::addHours(now,-72);

    super();

    if(element.args().menuItemName() == menuitemDisplayStr(HMCaseOnHoldLaggedListPage))
    {
        qbr=this.query().dataSourceName("HMCase_1").addRange(fieldNum(HMCase, DischargeDate));
        qbr.value(queryRange(DateTimeUtil::addYears(utcDateTimeNull(),2),lagdate));
        qbr=this.query().dataSourceName("HMCase_1").addRange(fieldNum(HMCase, CaseStatus));
        qbr.value(SysQuery::value(HMCaseStatus::OnHold));

    }
    else if(element.args().menuItemName() == menuitemDisplayStr(HMCaseWithoutDcPcListPage))
    {
        qbd=this.query().dataSourceName("HMCase_1").addDataSource(tableNum(HMCaseOtherDiagnosisCode1450));
        qbd.relations(true);
        qbd.joinMode(JoinMode::ExistsJoin);

        qbr=this.query().dataSourceName("HMCaseOtherDiagnosisCode1450_1").addRange(fieldNum(HMCaseOtherDiagnosisCode1450, RecId));

        qbr.value(strFmt('((%1.%2==%6) || ((%3.%4=="67") && (%3.%5==%6)))',
        this.query().dataSourceTable(tableNum(HMCase)).name(),
        fieldStr(HMCase,PrincipalProcedureCode),
        this.query().dataSourceTable(tableNum(HMCaseOtherDiagnosisCode1450)).name(),
        fieldStr(HMCaseOtherDiagnosisCode1450,Fieldlocator),
        fieldStr(HMCaseOtherDiagnosisCode1450,Code),0
        ));

    }
    else if(element.args().menuItemName() == menuitemDisplayStr(HMCaseReadyClaimListPage))
    {
        qbr=this.query().dataSourceName("HMCase_1").addRange(fieldNum(HMCase, DischargeDate));
        qbr.value(queryRange(DateTimeUtil::addYears(utcDateTimeNull(),2),lagdate));
        qbr=this.query().dataSourceName("HMCase_1").addRange(fieldNum(HMCase, CaseStatus));
        qbr.value(SysQuery::value(HMCaseStatus::Open));

        qbd=this.query().dataSourceName("HMCase_1").addDataSource(tableNum(HMCaseOtherDiagnosisCode1450));
        qbd.relations(true);
        qbd.joinMode(JoinMode::ExistsJoin);

        qbr=this.query().dataSourceName("HMCaseOtherDiagnosisCode1450_1").addRange(fieldNum(HMCaseOtherDiagnosisCode1450, RecId));

        qbr.value(strFmt('((%1.%2!=%6) && ((%3.%4=="67") && (%3.%5!=%6)))',
        this.query().dataSourceTable(tableNum(HMCase)).name(),
        fieldStr(HMCase,PrincipalProcedureCode),
        this.query().dataSourceTable(tableNum(HMCaseOtherDiagnosisCode1450)).name(),
        fieldStr(HMCaseOtherDiagnosisCode1450,Fieldlocator),
        fieldStr(HMCaseOtherDiagnosisCode1450,Code),0
        ));

        qbd=this.query().dataSourceName("HMCase_1").addDataSource(tableNum(HMCaseNotCompleted));
        qbd.joinMode(JoinMode::NoExistsJoin);
        qbd.addLink(fieldNum(HMCase,RecId),fieldNum(HMCaseNotCompleted,HMCase));

    }
    else if(element.args().menuItemName() == menuitemDisplayStr(HMCaseInCompleteCEListPage))
    {
         qbr=this.query().dataSourceName("HMCase_1").addRange(fieldNum(HMCase, DischargeDate));
        qbr.value(queryRange(DateTimeUtil::addYears(utcDateTimeNull(),2),lagdate));
        qbd=this.query().dataSourceName("HMCase_1").addDataSource(tableNum(HMCaseNotCompleted));
        qbd.joinMode(JoinMode::ExistsJoin);
        qbd.addLink(fieldNum(HMCase,RecId),fieldNum(HMCaseNotCompleted,HMCase));
    }
    else if(element.args().menuItemName() == menuitemDisplayStr(HMCaseOnHoldListPage))
    {
        this.query().dataSourceTable(tableNum(HMCaseTrans_CaseOnHold)).enabled(false);
    }

}

void clicked()
{
    MenuFunction    menuFunction;
    HMPatient hmPatient;
    Args args = new Args();

    select firstOnly hmPatient
    where hmPatient.RecId == HMPatient_1.RecId;

    menuFunction = new MenuFunction(menuitemDisplayStr(HMPatientChartRegistrationView), MenuItemType::Display);

    args.caller(element);
    args.record(hmPatient);
    menuFunction.run(args);
}

