void clicked()
{
    //super();
    int             recordsCount;
    HMCase          hmCase;
    container       con;
    Args            args;
    str             multiSelectString;
    RefRecId        hmPatientRecId;
    HMCaseStatus    hmCaseStatus;
    HMCase          hmCaseParent;
    HMCase          hmCaseChild;
    NoYes           isMergedBefore;


    args = new Args();
    recordsCount = HMCase_1_Ds.recordsMarked().lastIndex(); // gets the total records selected
    hmCase = HMCase_1_Ds.getFirst(1);
    hmPatientRecId = hmPatientRecId > 0 ? hmPatientRecId : hmCase.HMPatient;
    hmCaseStatus = (hmCaseStatus == HMCaseStatus::OnHold) ? hmCaseStatus : hmCase.CaseStatus;





    try
    {
        if (recordsCount >= 2)
        {
            while (hmCase)
            {
                select * from hmCaseParent
                    where hmCaseParent.HMParentCase == hmCase.CaseNo;

                if (hmPatientRecId == hmCase.HMPatient)
                {
                    if (hmCaseStatus == hmCase.CaseStatus && hmCase.CaseStatus == HMCaseStatus::OnHold)
                    {
                        if (hmCase.HMParentCase == "" && hmCaseParent.HMParentCase == "")
                        {
                            //storing recId of selected records in container
                            con = conIns(con, 1, hmCase.RecId);

                            //converting container to comma seperated string
                            multiSelectString = con2Str(con, ',');

                            hmCase = HMCase_1_ds.getNext();// moves to next record
                        }
                        else if (hmCaseParent.HMParentCase)
                        {
                            error(strFmt("Case: %1 is already merged", hmCaseParent.HMParentCase));
                            throw Exception::Error;
                        }
                        else
                        {
                            error(strFmt("Case: %1 is already merged", hmCase.CaseNo));//"Selected case cannot be Parent case before.");
                            throw Exception::Error;
                        }
                    }
                    else
                    {
                        error("Cases with status On-hold can only be merge.");
                        throw Exception::Error;
                    }
                }
                else
                {
                    error("Cases with different patient cannot be merge.");
                    throw Exception::Error;
                }
            }

            // passing string
            args.parm(multiSelectString);
            //calling menu item
            new MenuFunction(menuitemDisplayStr(HMCaseMergeDialog), MenuItemType::Display).run(args);
        }
        else
        {
            warning("Please select atleast two or more records to merge.");
        }
    }
    catch (Exception::Error)
    {

    }




}
